import React from "react";

function add(a,b){
    sum = a+b;
    return sum;
}
function mult(a,b){
    mul = a*b;
    return mul;
}
function div(a,b){
    if(a>=b){
        return a/b;
    }
    else{
        return alert("you have enter wrong values");
    }
}
function sub(a,b){
    return a-b;
}
export {add,sub,div,mult};
